import React from 'react';
import RecipeList from './components/RecipeList';
import RecipeByCuisine from './components/RecipeByCuisine';
import AddRecipe from './components/AddRecipe';
import MostCommonIngredients from './components/MostCommonIngredients';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Recipe App</h1>
      <RecipeList />
      <RecipeByCuisine />
      <AddRecipe />
      <MostCommonIngredients />
    </div>
  );
}

export default App;
